import React from "react";
import logo from "../src/Components/style/Images/logo.png";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Templates from "../src/Components/Templates";
import Signup from "../src/Components/Signup";
import Login from "../src/Components/Login";
import Home from "../src/Components/Home";
import Contact from "./Components/Contact";
import Container from "react-bootstrap/Container";

function Navbar() {
  window.onload = function () {
 let mainNav = document.getElementById("js-menu");
 let navBarToggle = document.getElementById("js-navbar-toggle");

 navBarToggle.addEventListener("click", function () {
   mainNav.classList.toggle("active");
 });
  };

  return (
    <Router>
      <Container fluid id="navbar">
        <div class="Navbar">
          <div class="Navbar__Link Navbar__Link-brand">Website title</div>
          <div class="Navbar__Link Navbar__Link-toggle">
            <i class="fas fa-bars"></i>
          </div>
          <nav class="Navbar__Items">
            <div class="Navbar__Link">Longer Link</div>
            <div class="Navbar__Link">Longer Link</div>
            <div class="Navbar__Link">Link</div>
          </nav>
          <nav class="Navbar__Items Navbar__Items--right">
            <div class="Navbar__Link">Link</div>
            <div class="Navbar__Link">Link</div>
          </nav>
        </div>
      </Container>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/templates">
          <Templates />
        </Route>
        <Route path="/contact">
          <Contact />
        </Route>
      </Switch>
    </Router>
  );
}

export default Navbar;
